import React, { useEffect, useState } from 'react'

const Search = () => {
  const [data, setData] = useState([])
  const fetchURL = "http://api.icndb.com/"
  const getData = () =>
    fetch(`${fetchURL}jokes/random/5`)
      .then((res) => res.json())

  useEffect(() => {
    getData().then((data) => setData(data))
  }, []);


  return (
    <div>
      {console.log(data.value)}
      <div>
      <table>
        {data.map((item =>
          <tr><td>{item}</td></tr>
        ))}
      </table>

      </div>
     



    </div>

  );
}

export default Search;
